using System;
using System.Collections.Generic;

namespace HackerRank
{
    public static class SteadyGene
    {
        public static void TestGetSteadyGeneLength()
        {
            var input = "";
            var result = GetSteadyGeneLenght(input);
            Console.WriteLine(result);
            // 50022
            
        }
        
        public static int GetSteadyGeneLenght(string input) {
            var result = 0;

            // calc occurrencies per char and 
            // built freq table (dictionary)
            var occurrenciesPerChar = input.Length / 4;
            var freqTable = new Dictionary<char, int>();
            freqTable.Add('A', 0);
            freqTable.Add('C', 0);
            freqTable.Add('G', 0);
            freqTable.Add('T', 0);
            foreach (var c in input)
            {
                freqTable[c]++;
            }
            
            // get overflowed chars and
            // calc Numbers of replacements to make
            var overflowChars = new HashSet<char>();
            var replacements = 0;
            var arraySize = 0;
            foreach (var c in freqTable)
            {
                if (c.Value > occurrenciesPerChar)
                {
                    overflowChars.Add(c.Key);
                    arraySize += c.Value;
                    replacements += c.Value - occurrenciesPerChar;
                }
            }

            // Console.WriteLine("occurrenciesPerChar: " + occurrenciesPerChar);
            // foreach (var e in overflowChars)
            // {
            //     Console.Write(e + ",");
            // }
            // Console.WriteLine();
            // Console.WriteLine("arraySize: " + arraySize);
            // Console.WriteLine("replacements: " + replacements);

            // build array of the indexes for each overflowed char
            var arrIndexes = new int[arraySize];
            var index = 0;
            for (var i = 0; i < input.Length; i++)
            {
                if (overflowChars.Contains(input[i]))
                {
                    arrIndexes[index++] = i;
                    //Console.WriteLine(i);
                }
            }

            // find/ calc the closest "number of replacements" based on the overflowed char's indexes
            var distance = -1;
            var resultIndex = 0;
            for (var i = 0; i < arrIndexes.Length - replacements; i++)
            {
                var tmp = arrIndexes[i + replacements - 1] - arrIndexes[i];  // getDistance(arrIndexes, i, replacements);
                if (distance == -1 || distance > tmp)
                {
                    distance = tmp;
                    resultIndex = i;
                }
            }
            // Console.WriteLine("Ini " + arrIndexes[resultIndex]);
            // Console.WriteLine("End " + arrIndexes[resultIndex + replacements - 1]);
            
            result = arrIndexes[resultIndex + replacements - 1] -
                arrIndexes[resultIndex];
            
            return result + 1;
        }

        private static int getDistance(
            int[] arrIndexes, int i, int replacements)
        {
            int result = 0;
            int initialValue = arrIndexes[i];
            for (var j = 0; j < replacements; j++, i++)
            {
                var tmp = arrIndexes[i] - initialValue;
                result += tmp;
            }
            return result;
        }
    }
}